// SPDX-License-Identifier: MIT
pragma solidity ^0.8.27;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract MockSeaport {
    function executeOrder(
        address token,
        uint256 tokenId,
        address seller,
        address buyer,
        address royaltyRecipient,
        uint256 salePrice,
        uint256 royaltyAmount
    ) external {
        // Transfer NFT from seller to buyer
        IERC721(token).transferFrom(seller, buyer, tokenId);

        // Transfer WETH from buyer to seller
        IERC20(msg.sender).transferFrom(buyer, seller, salePrice - royaltyAmount);

        // Transfer WETH from buyer to royalty recipient
        if (royaltyAmount > 0) {
            IERC20(msg.sender).transferFrom(buyer, royaltyRecipient, royaltyAmount);
        }
    }
}

